 // always setting `width: 100%;`. This works because we use `flex` values\n  // later on to override this initial width.\n  width: 100%\n  padding: $gutter / 2\n\n=make-col($size, $columns: $grid-columns)\n  flex: 0 0 percentage($size / $columns)\n  // Add a `max-width` to ensure content within each column does not blow out\n  // the width of the column. Applies to IE10+ and Firefox. Chrome and Safari\n  // do not appear to require this.\n  max-width: percentage($size / $columns)\n\n=make-col-offset($size, $columns: $grid-columns)\n  $num: $size / $columns\n  +ltr()\n    margin-left: if($num == 0, 0, percentage($num))\n  +rtl()\n    margin-right: if($num == 0, 0, percentage($num))\n\n=make-grid-columns($columns: $grid-columns, $gutter: $grid-gutter, $breakpoints: $grid-breakpoints)\n  // Common properties for all breakpoints\n  %grid-column\n    width: 100%\n    padding: $gutter / 2\n  @each $breakpoint in map-keys($breakpoints)\n    $infix: breakpoint-infix($breakpoint, $breakpoints)\n    // Allow columns to stretch full width below their breakpoints\n    @for $i from 1 through $columns\n      .col#{$infix}-#{$i}\n        @extend %grid-column\n    .col#{$infix},\n    .col#{$infix}-auto\n      @extend %grid-column\n    +media-breakpoint-up($breakpoint, $breakpoints)\n      // Provide basic `.col-{bp}` classes for equal-width flexbox columns\n      .col#{$infix}\n        flex-basis: 0\n        flex-grow: 1\n        max-width: 100%\n      .col#{$infix}-auto\n        flex: 0 0 auto\n        width: auto\n        max-width: 100% // Reset earlier grid tiers\n      @for $i from 1 through $columns\n        .col#{$infix}-#{$i}\n          +make-col($i, $columns)\n      // `$columns - 1` because offsetting by the width of an entire row isn't possible\n      @for $i from 0 through $columns - 1\n        @if not ($infix == \"\" and $i == 0)\n          // Avoid emitting useless .offset-0\n          .offset#{$infix}-#{$i}\n            +make-col-offset($i, $columns)\n","@import '..